import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { fetchJobsRequest } from '../../store/actions';
import JobCard from '../jobs/JobCard';
import './Home.css';

const Home = () => {
  const dispatch = useDispatch();
  const { jobs, loading } = useSelector((state) => state.jobs);
  const { isAuthenticated } = useSelector((state) => state.auth);

  useEffect(() => {
    // Fetch recent jobs for the home page
    dispatch(fetchJobsRequest({ limit: 6, status: 'active' }));
  }, [dispatch]);

  const featuredJobs = jobs.slice(0, 6);

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero">
        <div className="container">
          <div className="hero-content">
            <h1>Find Your Dream Job</h1>
            <p>
              Discover thousands of job opportunities with all the information you need. 
              Its your future. Come find it.
            </p>
            <div className="hero-actions">
              <Link to="/jobs" className="btn btn-primary btn-large">
                Browse Jobs
              </Link>
              {!isAuthenticated && (
                <Link to="/register" className="btn btn-secondary btn-large">
                  Create Account
                </Link>
              )}
            </div>
          </div>
        </div>
      </section>

      {/* Featured Jobs Section */}
      <section className="featured-jobs">
        <div className="container">
          <div className="section-header">
            <h2>Featured Jobs</h2>
            <p>Latest job opportunities from top companies</p>
          </div>

          {loading ? (
            <div className="loading">
              <div className="spinner"></div>
            </div>
          ) : (
            <div className="jobs-grid">
              {featuredJobs.map((job) => (
                <JobCard key={job.id} job={job} />
              ))}
            </div>
          )}

          <div className="section-footer">
            <Link to="/jobs" className="btn btn-primary">
              View All Jobs
            </Link>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <div className="container">
          <div className="section-header">
            <h2>Why Choose ISCO Job Board?</h2>
            <p>Everything you need to find your next career opportunity</p>
          </div>

          <div className="features-grid">
            <div className="feature-card">
              <div className="feature-icon">üîç</div>
              <h3>Easy Search</h3>
              <p>Find jobs that match your skills and preferences with our advanced search filters.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">üì±</div>
              <h3>Mobile Friendly</h3>
              <p>Apply for jobs on the go with our responsive design that works on all devices.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">‚ö°</div>
              <h3>Quick Apply</h3>
              <p>Submit your application with just a few clicks and track your application status.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">üè¢</div>
              <h3>Top Companies</h3>
              <p>Connect with leading companies and startups looking for talented professionals.</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
